{
  "name": "svg-term-cli",
  "version": "2.1.1",
  "description": "Share terminal sessions as razor-sharp animated SVG everywhere",
  "bin": {
    "svg-term": "./lib/cli.js"
  },
  "files": [
    "lib"
  ],
  "scripts": {
    "build": "tsc",
    "format": "prettier src/**/*.ts --write && tslint --project . --fix",
    "test": "jest"
  },
  "jest": {
    "globals": {
      "ts-jest": {
        "skipBabel": true
      }
    },
    "moduleFileExtensions": [
      "ts",
      "js",
      "json"
    ],
    "transform": {
      "^.+\\.tsx?$": "ts-jest"
    },
    "testRegex": ".*\\.test.ts"
  },
  "repository": {
    "type": "git",
    "url": "git+https://github.com/marionebl/svg-term-cli.git"
  },
  "keywords": [
    "svg",
    "asciinema",
    "asciicast"
  ],
  "author": "Mario Nebl <hello@mario-nebl.de>",
  "license": "MIT",
  "bugs": {
    "url": "https://github.com/marionebl/svg-term-cli/issues"
  },
  "homepage": "https://github.com/marionebl/svg-term-cli#readme",
  "dependencies": {
    "@marionebl/sander": "^0.6.1",
    "chalk": "^2.3.0",
    "command-exists": "^1.2.2",
    "execa": "^0.8.0",
    "get-stdin": "^5.0.1",
    "guess-terminal": "^1.0.0",
    "macos-app-config": "^1.0.1",
    "meow": "^3.7.0",
    "node-fetch": "^1.7.3",
    "plist": "^2.1.0",
    "svg-term": "^1.1.3",
    "svgo": "^1.0.3",
    "tempfile": "^2.0.0",
    "tempy": "^0.2.1",
    "term-schemes": "^1.2.0"
  },
  "devDependencies": {
    "@types/chalk": "^2.2.0",
    "@types/execa": "^0.8.0",
    "@types/jest": "^21.1.8",
    "@types/meow": "^3.6.2",
    "@types/svgo": "^0.7.0",
    "@types/tempfile": "^2.0.0",
    "@types/tempy": "^0.1.0",
    "jest": "^21.2.1",
    "jest-cli": "^21.2.1",
    "prettier": "^1.9.2",
    "ts-jest": "^21.2.3",
    "ts-node": "^3.3.0",
    "tslint": "^5.8.0",
    "tslint-config-prettier": "^1.6.0",
    "tslint-xo": "^0.4.0",
    "typescript": "^2.6.1",
    "xmldom": "^0.1.27"
  }
}
